*
 * 显示loading框
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = {
 *   message: '我在等待',
 * };
 * libSQ.exec('show-loading-view', {
 *   params,
 * }).then((info) => {
 *   alert(`[show-loading-view][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[show-loading-view][error] ${JSON.stringify(err, null, 2)}`);
 * });

